import { useEffect, useState } from 'react'

function Country() {
    const [country, setCountry] = useState([]);


    useEffect(() => {
        fetch('https://restcountries.com/v3.1/all')
            .then(response => response.json())
            .then(country => setCountry(country))
    }, [])



    return (
        <div>
            <h1>Country</h1>

        </div>
    )
}

export default Country
